DROP DATABASE IF EXISTS GAM_clean;
CREATE DATABASE GAM_clean;

USE GAM_clean;

CREATE TABLE betting_1 (
    AccountNo VARCHAR(50),
    BetDate DATE,
    ClassId VARCHAR(100),
    CategoryId INT,
    Source VARCHAR(50),
    BetCount INT,
    Bet_Amt DECIMAL(10,2),
    Win_Amt DECIMAL(10,2),
    Product VARCHAR(50)
);

CREATE TABLE betting_2 (
    AccountNo VARCHAR(50),
    Bet_Amt DECIMAL(10, 2),
    Product VARCHAR(50)
);

CREATE TABLE betting_3 (
    AccountNo VARCHAR(50),
    Product VARCHAR(50),
    Value DECIMAL(10, 2)
);

CREATE TABLE customer (
    CustId INT,
    AccountLocation VARCHAR(50),
    Title VARCHAR(10),
    FirstName VARCHAR(50),
    LastName VARCHAR(50),
    CreateDate DATE,
    CountryCode VARCHAR(10),
    Language VARCHAR(10),
    Status CHAR(1),
    DateOfBirth DATE,
    Contact CHAR(1),
    CustomerGroup VARCHAR(50)
);


CREATE TABLE product (
    CLASSID VARCHAR(50),
    CATEGORYID INT,
    product VARCHAR(50),
    sub_product VARCHAR(50),
    description VARCHAR(100),
    bet_or_play INT
);

CREATE TABLE account (
    AccountNo VARCHAR(50),
    CustId INT,
    AccountLocation VARCHAR(50),
    CurrencyCode VARCHAR(10),
    DailyDepositLimit DECIMAL(10, 2),
    StakeScale DECIMAL(5, 2),
    SourceProd VARCHAR(50)
);






